import { Component } from '@angular/core';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrl: './login.component.scss'
})
export class LoginComponent {
  user = {
    email: '',
    password: ''
  };

  onLogin() {
    console.log('Utilisateur connecté:', this.user);
    alert('Connexion réussie !');
  }
}
